	'descr_CACHEAUTHNREQUEST' => array (
		'no' => 'Autentiseringen er bekreftet, og klar til å sendes tilbake til tjenesten som ba om den, men nå finner vi ikke forespørselen. Vi holder på forespørsler bare en viss tid, og hvis du venter lenge før du oppgir brukernavn og passord kan slike feil som dette oppstå. Hvis dette kan være en mulig forklaring, prøv å koble deg opp på nytt til tjenesten for å starte innloggingen på nytt. Hvis dette ikke løser problemet, rapporter det som en feil.',
		'nn' => 'Du blir autentisert og skal sendast tilbake til webtenesta som treng innlogginga, men vi finn ikke bufferet med innloggingsinformasjonen din.  Prøv å gå tilbake til tenesta og logg inn igjen. Bufferet blir lagra i kort tid på grunn av tryggleiken din.  Dersom du har latt webklienten din stå lenge før du skreiv brukarnamn og passord, kan dette være ei forklaring på problemet.  Om problemet oppstår flere gonger, rapporter feilsituasjonen.',
		'da' => 'Du blev godkendt er klar til at blive sendt retur til tjenesten - men simpleSAMLphp kan desværre ikke finde din login-forespørgsel. Forespørgslen gemmes kun en kort tid. Hvis din browser har været åben i flere timer før end du indtastede brugernavn og kodeord kan være forklaringen. Hvis dette er tilfældet, kan du forsøge at gå tilbage til tjenesten for at logge ind på ny. Hvis problemet fortsætter, vær så venlig at sende en fejl-melding.',
		'en' => 'You were authenticated and ready to go back to the service requesting authentication, but we could not find your cached authentication request. The request is only cached for a limited amount of time. Leaving your browser open for hours before entering your username and password might be the cause of the problem. If this could be the case in your situation, try to go back to the service you want to access, and start a new login process. If the problem persists, please report it.',
		'de' => 'Sie wurden korrekt authentifiziert werden und sind breit, zurück zu dem Dienst geschickt zu werden, der die Authentifizierung angefordert hat, allerdings ist die gespeicherte Authentifizierungsanfrage nicht auffindbar. Diese Anfrage wird nur für einen begrenzten Zeitraum gespeichert. Eine mögliche Erklärung wäre, dass sie ihren Browser für ein paar Stunden offen gelassen haben, bevor sie Nutzername und Passwort eingegeben haben. Falls dies der Fall war, versuchen sie bitte erneut auf den Dienst zuzugreifen und starten sie somit einen neuen Anmeldevorgang. Bitte melden sie das Problem, falls es weiterhin besteht.',
		'sv' => 'Du är inloggad och det är klart för att skicka dig tillbaka till den tjänst som begärde inloggningen men det går inte att hitta den lagrade inloggningsförfrågan. Förfrågan är bara lagrad under en kort tid. En orsak kan vara att du lämnat din webbläsare öpen i flera timmar före du angav dina inloggningsuppgifter. Om så är fallet gå tillbaka till tjänsten som du ville logga in i och försök igen. Om problemet kvarstår bör du rapportera problemet.',
		'fi' => 'Autentikointi onnistui ja valmius palaamaan palveluun oli olemassa, mutta emme löytäneet istuntoasi välimuistista. Tiedot välimuistissa ovat vain rajallinen ajan saaatavaissa. Selaimen jättäminen tunneiksi auki, ennen tunnuksen ja salasanan syöttäminen voi olla ongelman aiheuttaja. Mikäli tämä on mahdollista, kokeile palaamista palveluun ja aloita uusi kirjautuminen. Mikäli ongelma jatkuu, ole hyvä ja ilmoita ylläpitäjille.',
		'es' => 'Has podido ser autenticado y est&aacute;s listo para retornar al servicio que solicit&oacute; la autenticaci&oacute;n, pero no es posible encontrar tu solicitud de autenticaci&oacute;n en cach&eacute;. Esta solicitud s&oacute;lo se conserva en cach&eacute; por un periodo limitado de tiempo. Si dej&oacute; su navegador abierto durante horas antes de introducir el nombre de usuario y la contrase&ntilde;a, esto pudo provocar este error. Si es esa la situaci&oacute;n, intente retornar al servicio que quer&iacute;a acceder e intente acceder de nuevo. Si el problema contin&uacute;a, por favor informe del problema',
		'fr' => 'Vous êtes authentifiés et prêts à être renvoyés vers le service qui a demandé l\'authentification, mais nous n\'avons pas retrouvé votre demande d\'authentification mise en cache. Cette demande est uniquement mise en cache pour une durée limitée. Si vous avez laissé votre navigateur inactif durant un long moment avant d\'entrer votre nom d\'utilisateur et votre mot de passe, cela pourrait être une explication possible. Si c\'est votre cas, essayez simplement de retourner au service auquel vous voulez accéder, et recommencez le processus d\'ouverture de session. Si ce problème persiste, veuillez le signaler s\'il vous plait.',
		'nl' => 'Je ben succesvol geauthenticeerd en gereed om terug te gaan naar de dienst die de authenticatie vereiste, maar het opgeslagen authenticatie verzoek kon niet worden teruggevonden. Het verzoek wordt slechts voor een beperkte duur opgeslagen. Als je je browser al langere tijd open hebt laten staan voordat je je gebruikersnaam en wachtwoord intikte, zou dat de oorzaak kunnen zijn. Als dit het geval is, ga dan terug naar de dienst die je wilde gebruiken en start het login proces opnieuw. Als het probleem blijft bestaan, meld het dan.',
		'lb' => 'Daer kënnt aerch authentifizéiren and dann gi der zeréeck bei den Service geschéckt, mais et wor net méiglech aer gespäicherten Authenticatiounsunfro ze fannen. Des Unfro get nemen fir limitéiert Zeit gespäichert. Wann der den Browser fir e puer Stonnen oploost ier daer de Benotzernumm an d\'Passwuert angid kinnt dat d\'Ursach dofir sinn. Wann dest op dësen Fall zoutréfft dann gid zréck bei den Sercice an lancéiert en neien Login. Wann de Problem dono nach emmer besteet,dann mellt den Problem.',
		'sl' => 'Zaradi daljšega obdobja neaktivnosti je seja potekla. Lahko se ponovno prijavite in samodejno boste preusmerjeni na storitev, ki je zahtevala avtentikacijo. ',
		'hr' => 'Došlo je do greške koja je najvjerojatnije uzrokovana time što ste u svom web pregledniku memorirali adresu stranice za unos korisničke oznake i zaporke umjesto adresu aplikacije kojoj želite pristupiti. Obzirom da veći broj aplikacija koristi isti središnji autentikacijski servis, ako svojim web preglednikom pristupite izravno sučelju za unos korisničke oznake i zaporke, autentikacijski servis ne zna na koju aplikaciju vas treba preusmjeriti nakon provjere ispravnosti korisničke oznake i zaporke. Problem možete riješiti na način da u vašem web pregledniku unesete ponovo adresu aplikacije kojoj želite pristupiti. Ako to ne riješi problem, molimo prijavite grešku administratorima.',
		'hu' => 'Sikeres azonosítás, de nem találtuk meg az átmeneti tárban az azonosítási kérést. Ez a kérés csak korlátozott ideig található meg az átmeneti tárban. Lehetséges, felhasználónév és jelszó megadása előtt több órán keresztül nyitva volt a bejelentkezési oldal. Ha ez a helyzet, akkor kérjük, menjen vissza a használni kívánt szolgáltatáshoz és jelentkezzen be újra. Ha a hiba továbbra is fennáll, kérjük, jelezze!',
		'pl' => 'Zostałeś uwierzytelniony i gotowy do powrotu do serwisu żądającego uwierzytelnienia, ale nie mogliśmy znaleźć zapamiętanego żądania uwierzytelnienia. Żądanie jest pamietane tylko przez określony czas. Pozostawiając swoją przegladarkę ze stroną logowania na kilka godzin zanim wpiszesz nazwę użytkownika i hasło mógł spowować ten problem. Jeśli to była przyczyna problemu, to spróbuj wrócić do serwisu i rozpocznuj nowy proces logowania. Jeśli znowu problem sie pojawi zgłoś to.',
		'pt' => 'Efectuou previamente uma autenticação com sucesso e estava prestes a ser direccionado para o serviço que requisitou a autenticação. No entanto não foi possível encontrar o pedido de autenticação na cache. O pedido apenas é mantido em cache por um período limitado. O problema pode ter sido originado por ter deixado o browser aberto durante alguma horas antes de introduzir as suas credenciais. Se foi este o caso tente aceder de novo ao serviço que necessita de autenticação, para iniciar um novo processo de entrada. Se o problema persistir, por favor comunique-o.',
		'pt-BR' => 'Você foi autenticado e pronto para voltar ao serviço de solicitação de autenticação, mas não foi possível encontrar o seu pedido de autenticação em cache. O pedido é armazenado em cache por um tempo limitado. Deixando o navegador aberto por horas antes de entrar seu nome de usuário e senha pode ser a causa do problema. Se este poderia ser o caso na sua situação, tente voltar para o serviço que você deseja acessar, e iniciar um novo processo autenticação. Se o problema persistir, por favor informe-nos.',
		'tr' => 'Kimliğiniz doğrulandı ve kimlik doğrulama isteyen servise gönderilmeye hazırsınız, ancak önbelleklenmiş kimlik doğrulama isteğini bulamadık. İstek, yalnızca belirli bir süre için önbelleklenir. Kullanıcı adı ve şifreyi girmeden önce tarayıcınızı saatlerce açık bırakmanız bu problemin sebebi olabilir. Eğer durum buysa, erişmek istediğiniz servise geri dönmeyi deneyin, ve yeni bir giriş işlemine başlayın. Eğer sorun devam ederse lütfen bildirin.',
	),
