		'no' => 'Dessverre finner vi ingen informasjon om arbeidsøkta di. Det kan skyldes at du har slått av handtering av informasjonskapsler (cookies) i nettleseren din, eller at nettleseren har vært åpen så lenge at maksimaltiden er overskredet.',
		'nn' => 'Vi var ikkje i stand til å finna sesjonen din.  Det kan vera fordi du mangler Cookies i webklienten din, eller dei er skrudd av hos deg.  Eller det kan vera fordi sesjonen din er blitt for gammel, noko som skjer dersom webklienten har stått open lenge.',
		'da' => 'Det var ikke muligt at finde din session. Dette kan skyldes at din browser ikke understøtter cookies eller at understøttelse af cookies er slået fra. Eller hvis du har haft din browser åbent længe, kan din session være udløbet. ',
		'en' => 'Unfortunately, we could not obtain your session information. This could be because your browser does not support cookies, or cookie handling is disabled. Alternately, your session timed out because you let the browser open for a long time.',
		'de' => 'Die Session konnte nicht gefunden werden. Möglicherweise unterstützt der Browser keine Cookies, oder Cookies sind deaktiviert. Eventuell ist die Session auch abgelaufen, weil der Browser zu lange offen war.',
		'sv' => 'Tyvärr kunde inte din session hittas. Detta kan bero på att din webbläsare inte kan hantera webbläsarkakor (cookies) eller att de inte tillåts. Men det kan också vara så att webbläsaren har varit startad så länge att maxtiden sessionen har uppnåtts.',
		'fi' => 'Valitettavasti istunnon tietoja ei ollut saatavana. Tämä voi johtua selaimesta, joka ei hyväksy evästeitä, tai evästeet ovat kiellettyjä selaimessa. Toinen vaihtoehto on, että istuntosi vanheni koska jätit selaimen auki liian kauan.',
		'es' => 'Desgraciadamente no hemos podido recuperar su sesi&oacute;n. Esto podr&iacute;a deberse a que su navegador no soporte cookies o a que las cookies est&aacute;n deshabilitadas.. O quiz&aacute;s su sesi&oacute;n caduc&oacute; si dej&oacute; su navegador abierto durante un periodo importante de tiempo.',
		'fr' => 'Nous n\'avons malheureusement pas pu reconnaitre votre session. Cela peut être parce que votre navigateur ne prend pas en charge les cookies ou que les cookies sont désactivés. Ou peut-être votre session a expiré parce que vous avez laissé votre navigateur inactif un long moment.',
		'nl' => 'Helaas kon er geen sessie worden gevonden. Dit kan worden veroorzaakt omdat uw browsser geen cookies ondersteunt, of deze niet gebruikt. Ook kan uw sessie verlopen zijn omdat uw browser al langere tijd openstaat.',
		'lb' => 'Onglëcklecherweis konnte mer aer Sessioun net feststellen. Ursach dofir kint sin dass aeren Browser keng cookies ënnerstëtzt oder des Funktioun désaktivéiert as. Alternativ kinnt et och sin dass aer Sessioun ofgelaaf as well den Browser ze lang op wor.',
		'sl' => 'Žal vaše seje ni bilo mogoče najti. Vzrok je lahko vaš brskalnik, ki ne podpira piškotkov, ali pa so piškotki onemogočeni. Drug možen vzrok je iztek časovne omejitve seje, ker ste pustili brskalnik predolgo odprt.',
		'hr' => 'Na žalost, ne možemo pronaći podatke o vašoj sjednici. Uzrok tome može biti to što vaš web preglednik nema omogućenu podršku za tzv. kolačiće (cookie). Također, jedan od razloga može biti i predugo otvoren web preglednik.',
		'hu' => 'Sajnos nem tudunk érvényes munkamenetet (session) meghatározni. Lehetséges, hogy böngészője nem támogatja a cookie-kat, illetve ezek le vannak tiltva. Amennyiben böngészője már régóta meg van nyitva, az is előfordulhat, hogy a munkamenet érvényessége lejárt.',
		'pt' => 'Não foi possível encontrar informação acerca da sua sessão. Este problema pode ser causado por o seu browser não suportar cookies ou ter este suporte desactivado. Em alternativa, a sua sessão pode ter expirado por ter deixado o browser aberto durante muito tempo.',
		'pt-BR' => 'Infelizmente, não foi possível obter informações da sua sessão. Isso pode ter ocorrido porque o seu navegador não suporta cookies ou a movimentação de cookies está desativado. Alternadamente, sua sessão expirou, pois você deixou o navegador aberto por muito tempo.',
		'tr' => 'Ne yazık ki oturum bilgilerinizi alamadık. Bu, tarayıcınızın çerez (cookie) desteklememesi ya da çerez desteğinin devre dışı bırakılması nedeniyle oluşmuş olabilir. Başka bir olasılık, tarayıcınızın uzun süre açık kalması sebebiyle oturumunuzun süresinin dolmasıdır.',
	),
