	'descr_LOGOUTINFOLOST' => array (
		'no' => 'Informasjonen om den nåværende utloggingen har gått tapt. Du bør gå tilbake til den opprinnelige tjesesten og prøve å logge ut på nytt. Informasjon om utloggingsoperasjoner er kun lagret i en begrenset tid - vanligvis noen timer. Dette er lengere tid enn en vanlig utlogging skal ta, så denne feilen kan tyde på at noe er galt med oppsettet. Ta kontakt med tjenesteyteren hvis problemet gjentar seg.',
		'nn' => 'Informasjon om utlogginga di har blitt borte.  Du bør gå tilbake til tenesta du prøver å logga ut av, og prøva ein gong til.  Feilen kan vera fordi utlogginga gjekk ut på tid.  Utloggingsinformasjon er lagra i eit kort tidsrom (vanlegvis nokre få timar), og dersom utlogging tar lengre tid kan det vera feil i andre deler av konfigurasjonen på webstaden du var innlogga på.  Dersom problemet ikkje blir borte, ta kontakt med webstaden du var innlogga på.',
		'da' => 'Oplysningerne om logout er tabt. Du bør gå tilbage til tjenesten du ønskede at logge ud af og prøve igen. Fejlen kan skyldes at oplysningerne blev forældet, da de kun gemmes i kort tid, typisk et par timer. Dette er dog længere end hvad det burde tage at logge ud, så denne fejl kan indikere en konfigurationsfejl. Hvis fejlen genopstår, bedes du kontakte tjenesteudbyderen.',
		'en' => 'The information about the current logout operation has been lost. You should return to the service you were trying to log out from and try to log out again. This error can be caused by the logout information expiring. The logout information is stored for a limited amout of time - usually a number of hours. This is longer than any normal logout operation should take, so this error may indicate some other error with the configuration. If the problem persists, contact your service provider.',
		'de' => 'Die Information des aktuellen Abmeldevorgangs ist verloren gegangen. Bitte rufen sie den Dienst auf, vom dem sie sich abmelden wollten, und versuchen sie dort das Abmelden nochmal. Dieser Fehler tritt auf, wenn die Abmeldeanfrage abläuft, da diese nur eine gewisse Zeit (üblicherweise ein paar Stunden) zwischengespeichert wird. Das sollte im normalen Betrieb ausreichend sein, da ein Abmeldevorgang nicht so lange dauert. Dieser Fehler kann also auch ein Anzeichen sein, daß ein Konfigurationsfehler vorliegt. Tritt dieser Fehler wiederholt auf, wenden sie sich bitte an den benutzen Dienst (Service Provider), vom dem sie sich abmelden wollen.',
		'sv' => 'Informationen om aktuell utloggning har försvunnit. Du bör återvända till tjänsten som du försökte logga ut från och försöka logga ut på nytt. Detta fel kan inträffa om informationen om utloggningen är för gammal. Utloggningsinformationen sparas en begränsad tid, oftas några timmar. Det är längre än vad utloggning bör ta så felet kan indikera något fel med konfigurationen. Om problemet kvarstår kontakta leverantören för den tjänst du försökte logga ut från.',
		'fi' => 'Uloskirjautumistiedot hävisivät. Sinun tulee palata siihen palveluun mistä aloitit uloskirjautumisen ja yrittää uutta uloskirjautumista. Tämä virhe voi johtua uloskirjautumistietojen vanhenemisesta. Uloskirjautumistietoja talletetaan vain rajatun ajan - usein vain tunteja. Tämä on selvästi pidempään kuin uloskirjautumisen pitäisi kesttä, joten virhe voi olla oire asetusten virheistä. Ota yhteuttä ylläpitäjään mikäli ongelma jatkuu.',
		'es' => 'La información sobre la operación de cierre de sesión se ha perdido. Debería volver al servicio del que intenta salir e intentar cerrar la sesión de nuevo. La información para cerrar la sesión se almacena durante un tiempo limitado, generalmente mucho más tiempo del que debería tardar la operación de cierre de sesión, de modo que este error puede deberse a algun error en la configuración. Si el problema persiste, contacte con el proveedor del servicio.',
		'fr' => 'Information de déconnexion perdue  Les informations afférantes à la procédure de déconnexion en cours ont été perdues. Tentez de retourner au service depuis lequel vous avez tenté de lancer la déconnextion, et essayez encore. Cette erreur peut être causée par un problème d&aopos;obsolescence des information de déconnexion, qui ne sont conservées que durant un temps limité, de l&aops;odre de quelques heures. Cette durée est bien plus longue qu\'une opération de déconnexion typique, ce qui suggère une autre erreur dans la configuration. Si le problème persiste, contactez l\'administrateur du fournisseur de service',
		'nl' => 'De informatie over de huidige logout operatie is verloren gegaan. Je zou nu moeten terugkeren naar de dienst waar je probeerde uit te loggen, om het nogmaals te proberen. Deze fout kan optreden wanneer de logout informatie is verlopen. De logout informatie wordt gedurende een beperkte tijdsduur bewaard, normaal gesproken een aantal uren. Dit is langer dan een normale logout operatie zou moeten duren, dus deze fout kan er op wijzen dat er een configuratie probleem is. Als het probleem zich blijft voordoen kun u contact opnemen met de Service Provider.',
		'sl' => 'Odjavni (Logout) parametri niso na voljo. Vrnite se na storitev, ki ste jo pravkar uporabljali in se ponovno poskusite odjaviti. Napaka je posledica poteka veljavnosti seje.',
		'hr' => 'Informacija o tekućem zahtjevu za odjavljivanjem se izgubila. Preporučamo da se vratite u aplikaciju iz koje ste se htjeli odjaviti i pokušate se odjaviti ponovo. Ova greška može biti uzrokovana istekom valjanosti zahtjeva za odjavom. Zahtjev se pohranjuje određeno vrijeme - u pravilu nekoliko sati. Obzirom da je to dulje nego što bi bilo koja operacija odjavljivanja trebala trajati, greška koja se pojavila može upućivati na grešku u konfiguraciji. Ako se problem nastavi, kontaktirajte vašeg davatelja usluge. ',
		'hu' => 'A kijelentkezési művelettel kapcsolatos információk valahol elvesztek. Kérjük, térjen vissza ahhoz a szolgáltatáshoz, ahonnan ki akart jelentkezni, és próbálja újra! Lehetséges, hogy a hibát az okozza, hogy a kijelentkezéshez szükséges információ elévült. A kijelentkezési információ csak korlátozott ideig érvényes - általában néhány óráig. Ez hosszabb, mint amennyi normális esetben a kijelentkezéshez szükséges, ezért ez a hibaüzenet konfigurációs hibát jelenthet. Ha a probléma továbbra is fennáll, kérjük, forduljon az alkalmazásszolgáltatóhoz (SP)!',
		'pt' => 'A informação acerca da operação de logout foi perdida. Por favor, volte ao serviço de onde efectuou o logout e tente de novo esta operação. A informação de logout possui um tempo de expiração que é normalmente muito superior ao tempo normal de processamento desta operação. Se o problema persistir pode ser um erro de configuração e deverá ser comunicado.',
		'pt-BR' => 'As informações sobre a operação de desconexão atual foram perdidas. Você deve voltar para o serviço que estava antes de tentar sair e tente novamente. Esse erro pode ser causado pela expiração das informações da desconexão. As informações são armazenadas em cache por uma quantia limitada de tempo - geralmente um número de horas. Esta é mais longa do que qualquer desconexão em funcionamento normal deve ter, de modo que este erro pode indicar algum outro erro com a configuração. Se o problema persistir, contate o seu fornecedor de serviços.',
